import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import footerAdornment from "../../assets/Footer Adornment.svg";
import { Grid } from "@material-ui/core";

import { Link } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  footer: {
    backgroundColor: theme.palette.common.red,
    width: "100%",
    zIndex: 1302,
    position: "relative",
  },
  adornment: {
    width: "25em",
    verticalAlign: "bottom",
    [theme.breakpoints.down("md")]: {
      width: "21em",
    },
    [theme.breakpoints.down("xs")]: {
      width: "15em",
    },
  },
  mainConatiner: {
    position: "absolute",
  },
  link: {
    color: "white",
    fontFamily: "Arial",
    fontSize: "0.75rem",
    fontWeight: "bold",
    textDecoration: "none",
  },
  gridItem: {
    margin: "3em",
  },
}));

export default function Footer(props) {
  const classes = useStyles();
  const { value, setValue, selectedIndex, setSelectedIndex } = props;


  return (
    <footer className={classes.footer}>
      <Grid container className={classes.mainConatiner} justify="center">
        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid item component={Link} onClick={()=>setValue(0)}to="/" className={classes.link}>
              Home
            </Grid>
          </Grid>
        </Grid>
        {/*  */}
        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid item component={Link} onClick={()=>setValue(1)}to="/services" className={classes.link}>
              Services
            </Grid>

            <Grid
              item
              component={Link}
              onClick={()=>setValue(1)}
              to="/customsoftware"
              className={classes.link}
            >
              Custom Software Development
            </Grid>
            <Grid
              item
              component={Link}
              onClick={()=>setValue(1)}
              to="/mobileapps"
              className={classes.link}
            >
              Mobile App Development
            </Grid>
            <Grid item component={Link} onClick={()=>setValue(1)} to="/websites" className={classes.link}>
              Website Development
            </Grid>
          </Grid>
        </Grid>
        {/*  */}
        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid
              item
              component={Link}
              onClick={()=>setValue(2)}
              to="/revolution"
              className={classes.link}
            >
              The Revolution
            </Grid>
            <Grid item component={Link} onClick={()=>setValue(2)}to="/vision" className={classes.link}>
              Vision
            </Grid>
            <Grid
              item
              component={Link}
              onClick={()=>setValue(2)}
              to="/technology"
              className={classes.link}
            >
              Technology
            </Grid>
            <Grid item component={Link} onClick={()=>setValue(2)} to="/process" className={classes.link}>
              Process
            </Grid>
          </Grid>
        </Grid>
        {/*  */}
        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid item component={Link} onClick={()=>setValue(3)} to="/about" className={classes.link}>
              About Us
            </Grid>
            <Grid item component={Link}  onClick={()=>setValue(3)}to="/history" className={classes.link}>
              History
            </Grid>
            <Grid item component={Link} to="/team" className={classes.link}>
              Team
            </Grid>
          </Grid>
        </Grid>
        {/*  */}
        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid item component={Link} to="/contact" className={classes.link}>
              Contact Us
            </Grid>
          </Grid>
        </Grid>
      </Grid>
      <img src={footerAdornment} alt="Footer" className={classes.adornment} />
    </footer>
  );
}
